import React from 'react'
import '../styles/Footer.css'

function Footer () {
  return (
    <>
    <div id='footer-contanier'>
    <div id='footer-copywrite-text'>
        <div id='footer-text-one'><p>Copyright &copy; 2019</p><p>h</p></div>
        <div id='footer-text-two'><p>Support</p></div>
    </div>
    <div id='footer-btn-container'><button id='footer-btn'>Add hodlinfo to home screen</button></div>
    </div>
    </>
  )
}

export default Footer;
